contract Token {

  /// @return total amount of tokens

  function totalSupply() pure public returns (uint256 supply);

  /// @param _owner The address from which the balance will be retrieved

  /// @return The balance

  function balanceOf(address _owner) pure public returns (uint256 balance);

  /// @notice send `_value` token to `_to` from `msg.sender`

  /// @param _to The address of the recipient

  /// @param _value The amount of token to be transferred

  /// @return Whether the transfer was successful or not

  function transfer(address _to, uint256 _value) public returns (bool success);

  /// @notice send `_value` token to `_to` from `_from` on the condition it is approved by `_from`

  /// @param _from The address of the sender

  /// @param _to The address of the recipient

  /// @param _value The amount of token to be transferred

  /// @return Whether the transfer was successful or not

  function transferFrom(address _from, address _to, uint256 _value) public returns (bool success);

  /// @notice `msg.sender` approves `_addr` to spend `_value` tokens

  /// @param _spender The address of the account able to transfer the tokens

  /// @param _value The amount of wei to be approved for transfer

  /// @return Whether the approval was successful or not

  function approve(address _spender, uint256 _value) public returns (bool success);

  /// @param _owner The address of the account owning tokens

  /// @param _spender The address of the account able to transfer the tokens

  /// @return Amount of remaining tokens allowed to spent

  function allowance(address _owner, address _spender) pure public returns (uint256 remaining);

  event Transfer(address indexed _from, address indexed _to, uint256 _value);

  event Approval(address indexed _owner, address indexed _spender, uint256 _value);

  uint public decimals;

  string public name;

}

/**

 * @title Ownable

 * @dev The Ownable contract has an owner address, and provides basic authorization control

 * functions, this simplifies the implementation of "user permissions".

 */

contract Ownable {

  address private _owner;

  event OwnershipTransferred(

    address indexed previousOwner,

    address indexed newOwner

  );

  /**

   * @dev The Ownable constructor sets the original `owner` of the contract to the sender

   * account.

   */

  constructor() internal {

    _owner = msg.sender;

    emit OwnershipTransferred(address(0), _owner);

  }

  /**

   * @return the address of the owner.

   */

  function owner() public view returns(address) {

    return _owner;

  }

  /**

   * @dev Throws if called by any account other than the owner.

   */

  modifier onlyOwner() {

    require(isOwner());

    _;

  }

  /**

   * @return true if `msg.sender` is the owner of the contract.

   */

  function isOwner() public view returns(bool) {

    return msg.sender == _owner;

  }

  /**

   * @dev Allows the current owner to relinquish control of the contract.

   * @notice Renouncing to ownership will leave the contract without an owner.

   * It will not be possible to call the functions with the `onlyOwner`

   * modifier anymore.

   */

  function renounceOwnership() public onlyOwner {

    emit OwnershipTransferred(_owner, address(0));

    _owner = address(0);

  }

  /**

   * @dev Allows the current owner to transfer control of the contract to a newOwner.

   * @param newOwner The address to transfer ownership to.

   */

  function transferOwnership(address newOwner) public onlyOwner {

    _transferOwnership(newOwner);

  }

  /**

   * @dev Transfers control of the contract to a newOwner.

   * @param newOwner The address to transfer ownership to.

   */

  function _transferOwnership(address newOwner) internal {

    require(newOwner != address(0));

    emit OwnershipTransferred(_owner, newOwner);

    _owner = newOwner;

  }

}

contract Dividends is Ownable {

  using SafeMath for uint256;    

  address public tokenAddress;

  Token public token;

// dividend receipt counter => value  

  mapping (uint256 => uint256) public dividends;

// address of wallet of founder => dividend counter

  mapping (address => uint256) public founders;

// dividend counter

  uint256 public dividendCounter;

  

  function setTokenAddress(address _address) onlyOwner public{

    tokenAddress = _address;

    token = Token(tokenAddress);  

  }

  function () external payable {

    address _this = this;  

    uint256 valueDividend;  

    if (msg.value == 0){

      require(_this.balance > 0);

      require(token.balanceOf(msg.sender) > 0);

      require(founders[msg.sender] < dividendCounter);

      valueDividend = 0;

      while (founders[msg.sender] < dividendCounter) {

        founders[msg.sender] = founders[msg.sender] + 1;

        valueDividend = valueDividend + dividends[founders[msg.sender]].mul(token.balanceOf(msg.sender)).div(token.totalSupply());

      }

      if (valueDividend > 0){

       // if (_this.balance < valueDividend){

       //   valueDividend = _this.balance;    

       // }  

        msg.sender.transfer(valueDividend);  

      }      

    }

    else {

      dividendCounter = dividendCounter + 1;

      dividends[dividendCounter] = msg.value;

    }

  }

}

